import { useState } from "react";

const Post = ()=>{
  const [list_of_post,setList_Of_Posts] = useState([{"postid":1,"username":"manav","feed":"fffffffffffffffffffffffff\
  ffffffffffffffffffffffffffffffffffffffffffffffffffffffff\
  ffffffffffffffffffffffffffffffffffffffffffffffffffffff","comment":"Hieelo manav"}]);
  
  return(
    <div>
      {
        list_of_post.map((post)=>{
          return(
            <div>
              <div >
                <h1>{post.username}</h1>
              </div>
              <div>
                <p>{post.feed}</p>
              </div>
              <div>
                <h1>{post.comments}</h1>
              </div>
            </div>
          )
        })
        
      }
    </div>
  )
}

export default Post;
